import React from 'react';
import Card from "./InfosCard";


const CardList = ({professors}) => {
    return(
        <div>
            {
                professors.map((user, i) => { console.log(user)
                    return (
                        <Card
                            professor={professors[i]}
                            key={i}
                            id={professors[i].id}
                            name={professors[i].name}
                            easiness={professors[i].easiness}
                            contents={professors[i].contents}/>
                    );
                })
            }
        </div>
    );
}

export default CardList;
